import logo from './logo.svg';
import './App.css';
// import  './components/Component.css';
// import  './login/Login.css';
import './calendar/Calendar.css';
var nextBtn ='>';
var prevBtn= '<';
function App() {
  return (
    <div className="calendar_box">
            <div className="cal_header">
            <div className="menu_bar">
                <div>
                    <span className="ico_cancel"><a className="cancel">X</a></span>
                    <span className="menu_title">일정 등록</span>
                    <span className="confirm_btn">확인</span>
                </div>
            </div>
            </div>
            <div className="cal_body">
              <div className="cal_body_box">
                  <div className="schedule_name">
                      <span>일정명</span>
                      <span><input type="text"></input></span>
                  </div>
                  <div className="shcedule_start">
                    <span>시작</span>
                    <span className="start_date"><input type="date"></input></span>
                    <span className="start_time"><input type="time"></input></span>
                  </div>
                  <div className="shcedule_end">
                    <span>종료</span>
                    <span className="end_date"><input type="date"></input></span>
                    <span className="end_time"><input type="time"></input></span>
                  </div>
                  <div className="shcedule_attendence">
                    <span>참석자</span>
                    <span className="attendence_name"><input type="text"></input></span>
                  </div>
                  <div className="shcedule_contents">
                    <span className="shcedule_txtarea"><textarea placeholder="내용을 입력하세요."></textarea></span>
                  </div>
                </div>
            </div>
    </div>


  );
}

export default App;
